import React from 'react';
import { connect } from 'react-redux';
import '../pages/contract/Contact.css';
const ShowContact = props => {
  console.log(props.contacts);
  const ids = props.contacts.map(con => con.id);
  console.log(ids);

  return (
    <div>
      <div className='contact'>
        <div className='contact-avatar'>
          <img />
        </div>
        <div className='contact-details'>
          <div className='contact-name'>Dan Smith</div>
          <div className='contact-phone'>(123) 745-526657</div>
        </div>
        <div className='contact-buttons'>
          <button>
            <i className='fa fa-phone' aria-hidden='true'></i>
          </button>
        </div>
        <div className='contact-button-close'>
          <i className='fa fa-times' aria-hidden='true'></i>
        </div>
      </div>
    </div>
  );
};
const mapStateToProps = state => ({
  contacts: state.contactMangment.contacts,
  loading: state.contactMangment.loading
});

export default connect(mapStateToProps)(ShowContact);
